package org.giddap.dreamfactory.leetcode.onlinejudge;

import org.giddap.dreamfactory.leetcode.onlinejudge.implementations.LongestValidParenthesesOnePassImpl;
import org.junit.Test;

import static org.junit.Assert.assertEquals;

/**
 *
 */
public class LongestValidParenthesesTest {
    //    private LongestValidParentheses solution = new LongestValidParenthesesDpImpl();
    private LongestValidParentheses solution = new LongestValidParenthesesOnePassImpl();

    @Test
    public void small01() {
        final String input = ")()()";
        final int actual = solution.longestValidParentheses(input);
        assertEquals(4, actual);
    }

    @Test
    public void small02() {
        final String input = "";
        final int actual = solution.longestValidParentheses(input);
        assertEquals(0, actual);
    }

    @Test
    public void small03() {
        final String input = "()(())";
        final int actual = solution.longestValidParentheses(input);
        assertEquals(6, actual);
    }

    @Test
    public void small04() {
        final String input = "(()()";
        final int actual = solution.longestValidParentheses(input);
        assertEquals(4, actual);
    }
}

